window.bookSummaryJSON = "<p>A ship stranded halfway across the galaxy. A difficult and lengthy journey home. A homeworld in urgent need of their return. And now they are running out of food. The crew of the <i>Aurora</i> must now trust their new allies in order to survive. But their situation may be far more serious than they imagined. And their actions could have repercussions across the galaxy. Their journey home may just have gotten slightly more complicated.</p>"; 
